import React from 'react';

export const SoundStageList = ({ soundStages }) => {
  console.log(soundStages); // Add this line to check the data

  if (!soundStages || soundStages.length === 0) {
    return <div>No sound stages available.</div>;
  }

  return (
    <div>
      {soundStages.map((studio, index) => (
        <div key={index}>
          <h2>{studio.studio_name}</h2>
          {studio.sound_stages.map((soundStage, stageIndex) => (
            <div key={stageIndex}>
              <h3>Sound Stage {soundStage.stage_number}</h3>
              {/* Render other information here */}
            </div>
          ))}
        </div>
      ))}
    </div>
  );
};
